review_text:
When we entered, the restaurant was full, but four tables needed to be cleaned. So as long as we were three, we decided to wait next to the double table and let the waitress know that we would love to sit at the next table, which had a couch. And then it started.
-Somehow the waitress decided to clean the most miniature table for us as long as she justified it would be faster;
-She accepted our order like we were enemies and she was a victim;
-The way she served plates was disgusting!
-We ordered thali with rice and got thali with noodles;
-We also got an eyebrow on one of the naan bread;
-We ordered tea, and the waitress forgot to bring it;
-We got a bill from the table next to us, ofc we paid as we had to pay, but the bill was somehow mixed and confusing;

This was the worst eating experience in Estonia during my six years here.
NOT RECOMMENDED!
